	add("hospital", "{\"term\":\"hospital\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027hospital\u0027 (Modern French \u0027hôpital\u0027 , from Latin {{m|la|hospitālis||hospitable}}, from \u0027hospes|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building designed to diagnose and treat the sick, injured or dying. Usually has a staff of doctors and nurses to aid in the treatment of patients\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A building founded for the long term care of its residents, such as an almshouse. The residents may have no physical ailments, but simply need financial support\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A place of lodging\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"II.ix\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"they spide a goodly castle, plast / Foreby a riuer in a pleasaunt dale, / Which choosing for that euenings \u0027\u0027hospitale\u0027\u0027, / They thither marcht\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The place and state of being hospitalized\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Luckily an ambulance arrived quickly and he was rushed to \u0027\u0027hospital\", \"priority\":7}]}, \"synonyms\":{}}");

	add("hospitality", "{\"term\":\"hospitality\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027hospitalite\u0027 (French \u0027hospitalité\u0027 , from Latin \u0027hospitalitas\u0027 (hospitality) from \u0027hospitalis\u0027 (hospitable) from \u0027hospes\u0027 (guest\u0026quot;, \u0026quot;host) Displaced native Old english (ca. 450-1100) \u0027giest-líðnys\u0027 (guestliness) from \u0027giest\u0027 (guest)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or service of welcoming, receiving, hosting, or entertaining guest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Please thank our hosts for their \u0027\u0027hospitality\u0027\u0027 during the week that we stayed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The business of providing catering, lodging and entertainment service\", \"priority\":3}]}, \"synonyms\":{}}");

