	add("hospiticide", "{\"term\":\"hospiticide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|hospiticīda}} or \u0027*hospiticīdium\u0027 from \u0027hospes\u0027 (host, guest) + {{m|la|-cīda||killer}}; equivalent to {{suffix||cide|lang\u003den}}.\u0026lt;ref name\u003d\u0026quot;OED1\u0026quot;\u0026gt;“Hospiʹticide” listed on [http://www.flickr.com/photos/oed1/3855421664/sizes/o page 407] of [http://www.fraktionary.com/index.php/OED:5_1_407 part I] of [http://www.archive.org/details/oedvol05 volume 5] of \u0027w:Oxford English Dictionary|A New English Dictionary on Historical Principles\u0027 (1928): \u0027\u0027Hospiʹticide.\u0027\u0027 \u0027rare\u0027\u0026lt;sup\u0026gt; — o\u0026lt;/sup\u0026gt;. [ad. rare Latin \u0027hospiticīda\u0027, f. \u0027hospes\u0027, \u0027hospit-\u0027 guest + \u0027-cīda\u0027, \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;-cide i.\u0026lt;/span\u0026gt;] One who kills his guest or host. (Blount \u0027Glossogr.\u0027 1656.)\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;OED2\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50108358 hoˈspiticide]” listed in the \u0027Oxford English Dictionary\u0027 (2nd edition, 1989)\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who kills his guest or host\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, Edward Smallwood, \u0027Manuella, the Executioner’s Daughter ; A Story of Madrid\u0027, volume II, [http://books.google.co.uk/books?id\u003dQuEMAAAAYAAJ\u0026amp;pg\u003dPA276\u0026amp;dq\u003d%22hospiticide%22\u0026amp;ei\u003dr3mmSpbmI5TkMN-Uvfc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hospiticide%22\u0026amp;f\u003dfalse pages 275–276\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Armed with the weapon which was destined to destroy himself, Imnaz sprang down the ladder, — found the door, and, emerging from the abode of crime, sought a more secure resting place, leaving his hostess to discover, with return of day, in whose blood were imbrued the hands of an \u0027\u0027hospiticide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act of a guest killing his host or vice versa, or an instance thereof\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, Edward Smallwood, \u0027Manuella, the Executioner’s Daughter ; A Story of Madrid\u0027, volume II, [http://books.google.co.uk/books?id\u003dQuEMAAAAYAAJ\u0026amp;pg\u003dPA261\u0026amp;dq\u003d%22hospiticides%22\u0026amp;lr\u003d\u0026amp;ei\u003dN4KmSpa6KJPSNOGHhe8\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hospiticides%22\u0026amp;f\u003dfalse page 261\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Anniversary of the Massacre of the Prado — the Defeat of Quesada — Murderous Reprisals — \u0027\u0027Hospiticides\", \"priority\":8}]}, \"synonyms\":{}}");

