	add("hostility", "{\"term\":\"hostility\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|hostilité}}, from {{m|la|hostilitas}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being hostile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is no \u0027\u0027hostilitie\u0027\u0027 so excellent, as that which is absolutely Christian\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 September 28, \u0026quot;[http://www.nytimes.com/2013/09/29/opinion/sunday/london-is-special-but-not-that-special.html?ref\u003dopinion London Is Special, but Not That Special],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 28 September 2013)\u0026lt;/small\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The polarization of wealth and the polarization of attitudes to diversity are not unrelated. A key reason for popular \u0027\u0027hostility\u0027\u0027 to immigrants is that to many people, particularly within working-class communities, immigration has become a symbol of unacceptable change\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A hostile action, especially a military action. See hostilities for specific plural definition\", \"priority\":6}]}, \"synonyms\":{}}");

	add("hostler", "{\"term\":\"hostler\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Syncopated form of \u0027\u0027 from Middle french (ca. 1400-1600) \u0027hostiler\u0027 from Old french (842-ca. 1400) \u0027hostelier\u0027 from Latin \u0027hostilarius\u0027 from \u0027hospitalarius\u0027 from \u0027hospitale\u0027 \u0026quot;inn\u0026quot;, from {{m|la|hospitālis}} \u0026quot;hospitable\u0026quot;, from \u0027hospes\u0027 \u0026quot;host, guest\u0026quot;. Both hostler and its alternate form \u0026quot;ostler\u0026quot; originally meant simply \u0026quot;innkeeper\u0026quot;, and acquired a specific association with horses in the second half of the 14th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person employed at an inn, hostelry, or stable to look after horses; a groo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person employed to care for a locomotive or other large engine\", \"priority\":2}]}, \"synonyms\":{}}");

